import React from "react";
import "./Common-section.css";
import { Container, Col, Row } from "reactstrap";

const CommonSection = () => {
  return (
    <section className="common_section">
      <Container>
        <Row>
          <Col></Col>
        </Row>
      </Container>
    </section>
  );
};
export default CommonSection;
